    false,nt"url": null,nt"notes": "NODC Accession 0112357 includes biological,
    chemical, discrete sample, physical and profile data collected from MIRAI in the
    Arctic Ocean and Beaufort Sea from 2004-09-01 to 2004-10-13 and retrieved during
    cruise MR04-05 and PACIFICA_49NZ20040901. These data include ALKALINITY, AMMONIUM,
    CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12
    (CFC-12), CHLOROPHYLL A, DISSOLVED OXYGEN, Delta Oxygen - 18, HYDROSTATIC PRESSURE,
    Methane, NITRATE, NITRITE, PHOSPHATE, SALINITY, SILICATE and WATER TEMPERATURE.
    The instruments used to collect these data include CTD, Coulometer for DIC measurement
    and bottle. These data were collected by Shigeto Nishino and Koji Shimada of Japan
    Agency for Marine-Earth Science and Technology (Jamstec) as part of the PACIFICA_49NZ20040901
    data set.nnPACIFICA (PACIFic ocean Interior CArbon) was an international collaborative
    project for the data synthesis of ocean interior carbon and its related parameters
    in the Pacific Ocean. The North Pacific Marine Science Organization (PICES), Section
    of Carbon and Climate (S-CC) supported the project.",nt"license_title": null,nt"extras":
